import React, { useState } from 'react';
import Ho from './Home.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';


function Home() {
  return (
    <div className={Ho.homain}>
      <div className={Ho.hocont}>
      <div className={Ho.homn}>
         <h1>Logo</h1>
         <FontAwesomeIcon icon={faHouse} /> <p>Dashboard</p>
         <FontAwesomeIcon icon={faHouse} /> <p>Invitations</p>
         <FontAwesomeIcon icon={faHouse} /><p>Your Activities</p>
         <FontAwesomeIcon icon={faHouse} /><p>Chat</p>
         <FontAwesomeIcon icon={faHouse} /><p>Settings</p>
      </div>
      <div className={Ho.horiz}>
         
      </div>
      </div>
    </div>
  );
}
export default Home;
